import React, { Component } from "react";
import { makeStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";
import Grid from "@material-ui/core/Grid";

const useStyles = makeStyles(theme => ({
  wrapper: {
    height: "100vh",
    background: `url(${"https://t3.ftcdn.net/jpg/02/51/62/16/240_F_251621641_uE15qPVD3AfU97Z90SjQKa9GyhOElNGV.jpg"}) no-repeat`,
    backgroundSize: "cover"
  },
  mainContainer: {},
  button: {
    margin: theme.spacing(1),
    width: 400
  },
  textField: {
    marginLeft: theme.spacing(1),
    marginRight: theme.spacing(1),
    width: 400
  },
  input: {
    display: "none"
  }
}));

export default function Login() {
  const classes = useStyles();
  return (
    <div className={classes.wrapper}>
      <Grid
        container
        direction="column"
        alignItems="center"
        className={classes.mainContainer}
      >
        <Grid item md={12}>
          <Grid container direction="row">
            <Grid item md={3}>
              <img
                width="100"
                height="100"
                alt=""
                src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/48/GoogleMaps_logo.svg/1011px-GoogleMaps_logo.svg.png"
              />
            </Grid>
            <Grid item md={9}>
              <h1
                style={{
                  margin: 0,
                  paddingLeft: 10,
                  display: "inline"
                }}
              >
                <span style={{ verticalAlign: "botto" }}></span>
                Rastreador Mobile
              </h1>
            </Grid>
          </Grid>
        </Grid>
        <Grid item md={12}>
          <TextField
            id="standard-name"
            label="Email"
            className={classes.textField}
            onChange={() => {}}
            margin="normal"
          />
        </Grid>
        <Grid item md={12}>
          <TextField
            id="standard-name"
            label="Password"
            className={classes.textField}
            onChange={() => {}}
            margin="normal"
          />
        </Grid>
        <Grid item md={12}>
          <Button
            variant="contained"
            color="primary"
            className={classes.button}
          >
            Login
          </Button>
        </Grid>
        <Grid item md={12}>
          <Button
            variant="contained"
            color="default"
            className={classes.button}
          >
            Register
          </Button>
        </Grid>
      </Grid>
    </div>
  );
}
